    { name = "pandas" },
    { name = "pandera" },
    { name = "pydantic" },
    { name = "pydantic-settings" },
    { name = "pytest-cov" },
    { name = "python-dotenv" },
    { name = "types-cachetools" },
    { name = "types-psutil" },
]

[package.dev-dependencies]
dev = [
    { name = "memory-profiler" },
    { name = "mypy" },
    { name = "pre-commit" },
    { name = "psutil" },
    { name = "pytest" },
    { name = "pytest-asyncio" },
    { name = "pytest-benchmark" },
    { name = "pytest-cov" },
    { name = "pytest-xdist" },
    { name = "types-cachetools" },
]

[package.metadata]
requires-dist = [
    { name = "cachetools", specifier = ">=5" },
    { name = "pandas", specifier = ">=2.3.0" },
    { name = "pandera", specifier = ">=0.22.1" },
    { name = "pydantic", specifier = ">=2" },
    { name = "pydantic", specifier = ">=2.10.5" },
    { name = "pydantic-settings", specifier = ">=2.7.1" },
    { name = "pytest-cov", specifier = ">=6.1.1" },
    { name = "python-dotenv", specifier = ">=1" },
    { name = "types-cachetools", specifier = ">=6.0.0.20250525" },
    { name = "types-psutil", specifier = ">=7.0.0.20250601" },
]

[package.metadata.requires-dev]
dev = [
    { name = "memory-profiler", specifier = ">=0.61.0" },
    { name = "mypy", specifier = ">=1.0.0" },
    { name = "pre-commit", specifier = ">=4.2.0" },
    { name = "psutil", specifier = ">=5.9.5" },
    { name = "pytest", specifier = ">=7.4.0" },
    { name = "pytest-asyncio", specifier = ">=0.21.0" },
    { name = "pytest-benchmark", specifier = ">=4.0.0" },
    { name = "pytest-cov", specifier = ">=4.1.0" },
    { name = "pytest-xdist", specifier = ">=3.3.1" },
    { name = "types-cachetools", specifier = ">=6.0.0.20250525" },
]
